import './with-spinner.styles.css';

export const WithSpinner = () => {
    return (
        <div className="spinner">
  <div class="bar1"></div>
  <div class="bar2"></div>
  <div class="bar3"></div>
  <div class="bar4"></div>
  <div class="bar5"></div>
</div>
    );
};

export default WithSpinner;
